con:config.script:
import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

//context variable is used to access and modify properties of testcase
//scope of context lies in TestCase only
log.info context.expand('${#TestCase#description}')

//To acess any property you have to come through its parent only
def firstNum = testRunner.testCase.testSuite.getPropertyValue("1st Number")
def secondNum = testRunner.testCase.testSuite.getPropertyValue("2nd Number")

//Get Add request property, returning XML
def addRequest = testRunner.testCase.testSuite.testCases["AddTestCase"].testSteps["Add"].getPropertyValue("Request")
def xmlAddRequest = new XmlHolder(addRequest);
xmlAddRequest.setNodeValue("//soap:Body/tem:Add/tem:intA", firstNum)
xmlAddRequest.setNodeValue("//soap:Body/tem:Add/tem:intB", secondNum)

//Get new Xml with added Node value and assign to variable
def newXmlAddRequest = xmlAddRequest.getXml()

//set request property value of add test case with new xml variables
testRunner.testCase.testSuite.testCases["AddTestCase"].testSteps["Add"].setPropertyValue("Request", newXmlAddRequest)

//call the service Add after add request with new XML variables.
def addTestStep = testRunner.testCase.testSuite.testCases["AddTestCase"].testSteps["Add"]
//Assign to context
def contextAddNumbers = new WsdlTestRunContext(addTestStep)

//service.run(testRunner, context)
addTestStep.run(testRunner, contextAddNumbers)

//Validate add 
def addResponse= testRunner.testCase.testSuite.testCases["AddTestCase"].testSteps["Add"].getPropertyValue("Response")
def xmlAddResponse = new XmlHolder(addResponse)
def AddResult = Integer.parseInt(xmlAddResponse.getNodeValue("//soap:Body/*/*/text()"))
def add = Integer.parseInt(firstNum) + Integer.parseInt(secondNum)
assert AddResult == add, "Actual result and expected result do not match"

//Validate http response code
def addHeader = testRunner.testCase.testSuite.testCases["AddTestCase"].testSteps["Add"].testRequest.response.getResponseHeaders()
assert addHeader["#status#"]==['HTTP/1.1 200 OK']




//Now for the Substract TestCase

def substractRequest = testRunner.testCase.testSuite.testCases["SubstractTestCase"].testSteps["Substract"].getPropertyValue("Request")
def xmlSubstractRequest= new XmlHolder(substractRequest)

xmlSubstractRequest.setNodeValue("//soap:Body/tem:Divide/tem:intA", firstNum)
xmlSubstractRequest.setNodeValue("//soap:Body/tem:Divide/tem:intB", secondNum)

def newXmlSubstractRequest = xmlSubstractRequest.getXml()
testRunner.testCase.testSuite.testCases["SubstractTestCase"].testSteps["Substract"].setPropertyValue("Request", newXmlSubstractRequest)

def serviceSubstractRequest = testRunner.testCase.testSuite.testCases["SubstractTestCase"].testSteps["Substract"]
def contextSubstractNumbers = new WsdlTestRunContext(serviceSubstractRequest)

serviceSubstractRequest.run(testRunner,contextSubstractNumbers)
//validate Substract result
def substractResponse = testRunner.testCase.testSuite.testCases["SubstractTestCase"].testSteps["Substract"].getPropertyValue("Response")
def xmlSubstract = new XmlHolder(substractResponse)
def substractResult = Integer.parseInt(xmlSubstract.getNodeValue("//soap:Body/*/*/text()"))
def expSubstractResult = Integer.parseInt(firstNum) - Integer.parseInt(secondNum)

//Validate http response code
def divideHeader = testRunner.testCase.testSuite.testCases["SubstractTestCase"].testSteps["Substract"].testRequest.response.getResponseHeaders()
assert divideHeader["#status#"]==['HTTP/1.1 200 OK']



//Now for the Multiply 

//Now for the Multiply TestCase
def multiplyRequest = testRunner.testCase.testSuite.testCases["MultiplyTestCase"].testSteps["Multiply"].getPropertyValue("Request")
def xmlMultiplyRequest= new XmlHolder(multiplyRequest)

xmlMultiplyRequest.setNodeValue("//soap:Body/tem:Divide/tem:intA", firstNum)
xmlMultiplyRequest.setNodeValue("//soap:Body/tem:Divide/tem:intB", secondNum)

def newXmlMultiplyRequest = xmlMultiplyRequest.getXml()
testRunner.testCase.testSuite.testCases["MultiplyTestCase"].testSteps["Multiply"].setPropertyValue("Request", newXmlMultiplyRequest)

def serviceMultiplyRequest = testRunner.testCase.testSuite.testCases["MultiplyTestCase"].testSteps["Multiply"]
def contextMultiplyNumbers = new WsdlTestRunContext(serviceMultiplyRequest)

serviceMultiplyRequest.run(testRunner,contextMultiplyNumbers)
//validate multiply result
def multiplyResponse = testRunner.testCase.testSuite.testCases["MultiplyTestCase"].testSteps["Multiply"].getPropertyValue("Response")
def xmlMultiply = new XmlHolder(multiplyResponse)
def multiplyResult = Integer.parseInt(xmlMultiply.getNodeValue("//soap:Body/*/*/text()"))
def expMultiplyResult = Integer.parseInt(firstNum)* Integer.parseInt(secondNum)

//Validate http response code
def multiplyHeader = testRunner.testCase.testSuite.testCases["MultiplyTestCase"].testSteps["Multiply"].testRequest.response.getResponseHeaders()
assert multiplyHeader["#status#"]==['HTTP/1.1 200 OK']



//Now for the Divide TestCase
def divideRequest = testRunner.testCase.testSuite.testCases["DivideTestCase"].testSteps["Divide"].getPropertyValue("Request")
def xmlDivideRequest= new XmlHolder(divideRequest)

xmlDivideRequest.setNodeValue("//soap:Body/tem:Divide/tem:intA", firstNum)
xmlDivideRequest.setNodeValue("//soap:Body/tem:Divide/tem:intB", secondNum)

def newXmlDivideRequest = xmlDivideRequest.getXml()
testRunner.testCase.testSuite.testCases["DivideTestCase"].testSteps["Divide"].setPropertyValue("Request", newXmlDivideRequest)

def serviceDivideRequest = testRunner.testCase.testSuite.testCases["DivideTestCase"].testSteps["Divide"]
def contextDivideNumbers = new WsdlTestRunContext(serviceDivideRequest)

serviceDivideRequest.run(testRunner,contextDivideNumbers)
//validate divide result
def divideResponse = testRunner.testCase.testSuite.testCases["DivideTestCase"].testSteps["Divide"].getPropertyValue("Response")
def xmlDivide = new XmlHolder(divideResponse)
def divideResult = Integer.parseInt(xmlDivide.getNodeValue("//soap:Body/*/*/text()"))
def expDivideResult = Integer.parseInt(firstNum)/ Integer.parseInt(secondNum)
assert divideResult == expDivideResult

//Validate http response code
def DivideHeader = testRunner.testCase.testSuite.testCases["DivideTestCase"].testSteps["Divide"].testRequest.response.getResponseHeaders()
assert divideHeader["#status#"]==['HTTP/1.1 200 OK']

